    await page.$eval('div[data-video-id="1"] input.volume-slider', (slider) => {
      slider.value = 0.5;
      slider.dispatchEvent(new Event('input', { bubbles: true }));
      slider.dispatchEvent(new Event('change', { bubbles: true }));
    });

    // Verify volume was set correctly
    const volumeValue = await page.$eval('div[data-video-id="1"] input.volume-slider', el => el.value);

    // Take screenshot after setting volume
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_volume_set.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_volume_set.png'));

    return {
      success: true,
      action: "Set first video's volume slider to 50%",
      extractedData: {
        volumeValue: volumeValue,
        videoId: '1',
        expectedVolume: '0.5'
      },
      screenshots,
      error: null
    };
  } catch (error) {
    // Take screenshot on error
    await page.screenshot({ path: path.join(screenshotsDir, 'error.png') });
    screenshots.push(path.join(screenshotsDir, 'error.png'));

    return {
      success: false,
      action: "Failed to set volume slider",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
